import React, { Component } from 'react';

class AddPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Name: '',
      Avail: '',
      Price: ''
    };
  }
  render() {
    return (
      <div>
        <input
          type='text'
          name='Name'
          value={this.state.Name}
          onChange={this.change}
        />
        <input
          type='number'
          name='Avail'
          value={this.state.Avail}
          onChange={this.change}
        />
        <input
          type='number'
          name='Price'
          value={this.state.Price}
          onChange={this.change}
        />
      </div>
    );
  }
}

export default AddPage;
